import React from 'react';
import { View, Text, Image, ScrollView, StyleSheet } from 'react-native';

const Profile = () => {
  return (
    <ScrollView>
      <View style={styles.container}>
        <View style={styles.leftBox}>
          <Text style={styles.boxTitle}>Previous Game List</Text>
          {/* Add previous game list content here */}
        </View>

        <View style={styles.middleBox}>
          <View style={styles.upperMiddle}>
            <Text style={styles.boxTitle}>Welcome, User Name</Text>
            {/* Add content for the upper part of the middle box here */}
          </View>
          <View style={styles.lowerMiddle}>
            <Text style={styles.middleText}>Upcoming Game List</Text>
            <Image
              source={{ uri: 'https://example.com/fake-pic.jpg' }}
              style={styles.image}
            />
            <View style={styles.box}>
              <Text style={styles.boxTitle}>Assigned Groups</Text>
              {/* Add options for assigned groups */}
              <Text>Group One</Text>
              <Text>Group Two</Text>
              <Text>Group Three</Text>
              {/* ... Add more options as needed */}
            </View>
          </View>
        </View>

        <View style={styles.rightBox}>
          {/* Right box content */}
        </View>
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flexDirection: 'row',
  },
  leftBox: {
    flex: 1,
    // Styling for the left box
  },
  middleBox: {
    flex: 1,
    flexDirection: 'column', // Stack children vertically
    // Styling for the middle box
  },
  upperMiddle: {
    flex: 1,
    backgroundColor: 'white',
    borderRadius: 10,
    borderWidth: 1,
    borderColor: 'black',
    padding: 10,
    margin: 10,
    // Styling for the upper part
  },
  lowerMiddle: {
    flex: 1,
    backgroundColor: 'white',
    borderRadius: 10,
    borderWidth: 1,
    borderColor: 'black',
    padding: 10,
    margin: 10,
    // Styling for the lower part
  },
  rightBox: {
    flex: 1,
    // Styling for the right box
  },
  boxTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    marginTop: 10,
  },
  middleText: {
    fontSize: 24,
    fontWeight: 'bold',
  },
  image: {
    width: 200,
    height: 200,
    marginTop: 10,
  },
});

export default Profile;
